import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Button from 'react-bootstrap/Button'
import ButtonGroup from 'react-bootstrap/ButtonGroup';
import { el as lngEl } from '../../Languages/el.json';
import { en as lngEn } from '../../Languages/en.json';
import { ka as lngKa } from '../../Languages/ka.json';

export default class LanguageSelector extends React.Component {

    render() {
        return(
            <Row
                style={{
                    textAlign: 'right'
                }}
            >
                <Col
                    xs={12} sm={12} md={12} lg={12}
                >



                    <ButtonGroup
                        className="mr-2"
                        size="sm"
                    >
                        <Button
                            style={{
                                margin: '0.15em'
                            }}
                        >1</Button>
                        <Button
                            style={{
                                margin: '0.15em'
                            }}
                        >2</Button>
                        <Button
                            style={{
                                margin: '0.15em'
                            }}
                        >3</Button>
                    </ButtonGroup>


                </Col>
            </Row>
        )
    }

}
